import {Button, ButtonGroup, Card, Col, Container, FloatingLabel, Form, ListGroup, Row} from "react-bootstrap";
import {useState} from "react";
import CountryInput from "./CountryInput";
import CountryList from "./CountryList";
import ajax from "../api/ajax";

function CountryBox() {

    const [dataWholeCountries, setDataWholeCountries] = useState(T_dataCountries);


    function onApply(){
        deleteCountries();
        onInsert();
    }
    function onInsert() {
        // console.log(dataWholeCountries);
        dataWholeCountries.forEach((country) => {
            insertCountry(country.name);
        });
    }

    async function insertCountry(countryName) {
        console.log("Insert New Whole Countries");
        await ajax("api/insert/countries", {name: countryName}, 'POST').then(e => {
            console.log("-- node list ajax body --");
            console.log(e.data);
        });
        // return T_dataCountries;
    }

    function onClear() {
        deleteCountries();
        setDataWholeCountries([]);
    }

    async function deleteCountries() {
        console.log("in DEL Countries");
        await ajax("api/delete", {}, 'DELETE').then(e => {
            console.log("DEL Countries");
            console.log(e.data);
        });
    }


    return (

        <div className="App">
            <header className="App-header">
            </header>
            <main>
                <Container xs={5}>
                    <Row className="justify-content-center">
                        <Col xs={5}>
                            <Card className="p-3 shadow-sm navbar-nav-scroll">
                                <Row>
                                    <Col>
                                        <Form.Label htmlFor="datacountries"
                                                    className="text-primary mb-3">Countries</Form.Label>
                                        <Form.Control id="datacountries"
                                                      as="textarea" rows={10}
                                                      value={(() => {
                                                          return dataWholeCountries.map((o) => {
                                                              return o.name;
                                                          }).join('\n');
                                                      })()}
                                                      onChange={(e) => {
                                                          // console.log(e.target.value.split(/\r?\n/));
                                                          setDataWholeCountries(
                                                              e.target.value.split(/\r?\n/).map((item) => {
                                                                  return {name: item}
                                                              }));
                                                      }}/>
                                    </Col>
                                    <Row>
                                        <Col>
                                             <Row className="mt-3 mb-3">
                                                 <ButtonGroup>
                                                    <Button variant="outline-success" className="w-50" onClick={onInsert}>Load Data</Button>
                                                    <Button variant="primary" className="w-50" onClick={onInsert}>Apply</Button>
                                                </ButtonGroup>
                                            </Row>
                                            <Row>

                                                <ButtonGroup>
                                                    <Button variant="outline-danger" className="w-50" onClick={onClear}>Clear Data</Button>
                                                    <Button variant="danger" className="w-50" onClick={onClear}>Delete Data</Button>
                                                </ButtonGroup>

                                            </Row>

                                        </Col>
                                    </Row>
                                </Row>
                            </Card>
                        </Col>
                    </Row>
                </Container>
            </main>
        </div>
    );
}


async function loadCountries(iniData) {
    console.log("ini Data ====== ");
    await ajax("api/testing/select", {}).then(e => {
        console.log("-- node list ajax body --");
        console.log(e.data);
        iniData(e.data);
    });
    // return T_dataCountries;
}

export default CountryBox;

const T_dataCountries = [{id: 1, name: 'Albania'},
    {id: 2, name: 'Andorra'},
    {id: 3, name: 'Australia'},
    {id: 4, name: 'Brazil'},
    {id: 5, name: 'Belgium'},
    {id: 6, name: 'Canada'},
    {id: 7, name: 'China'},
    {id: 8, name: 'France'},
    {id: 9, name: 'Germany'},
    {id: 10, name: 'India'},
    {id: 11, name: 'Indonesia'},
    {id: 12, name: 'Ireland'},
    {id: 13, name: 'Italy'},
    {id: 14, name: 'Japan'},
    {id: 15, name: 'Kenya'},
    {id: 16, name: 'Luxembourg'},
    {id: 17, name: 'Mexico'},
    {id: 18, name: 'New Zealand'},
    {id: 19, name: 'Nigeria'},
    {id: 20, name: 'Portugal'},
    {id: 21, name: 'Russia'},
    {id: 22, name: 'South Africa'},
    {id: 23, name: 'South Korea'},
    {id: 24, name: 'Spain'},
    {id: 25, name: 'Sweden'},
    {id: 26, name: 'Thailand'},
    {id: 27, name: 'Ukraine'},
    {id: 28, name: 'United Kingdom'},
    {id: 29, name: 'United States of America'},
    {id: 30, name: 'Vietnam'},
    {id: 31, name: 'Zambia'}];
